import React from 'react';
import './List.css';
import ReturnIcon from './Icon';
import { Link, useNavigate } from 'react-router-dom';
import { TweenMax, Linear } from 'gsap';

// List Nav COmpoent 
export default function ReturnLisT() {
 const navigation = useNavigate();
 React.useEffect(() => {

  TweenMax.staggerFrom('.dash-list-nav ul li', 1.2, { delay: 1, opacity: 0, y: 20, ease: Linear }, 0.08)

 }, []);
 return (
  <div className='dash-list-nav'>
   <ul>

    <li><ReturnIcon IMA={'/img/people.png'} Text={'Ajouter agent'} /></li>
    <li><ReturnIcon IMA={'/img/calendar.png'} Text={`Carnet d'ordre`} /></li>
    <li><ReturnIcon IMA={'/img/info.png'} Text={`Information Client`} /></li>
    <li><ReturnIcon IMA={'/img/trash-client.png'} Text={`Suprimer Client`} /></li>
    <li><ReturnIcon IMA={'/img/close.png'} Text={`Password Admin`} /></li>
    <li><ReturnIcon IMA={'/img/add-money.png'} Text={`Augmenter Commussion`} /></li>
    <li><ReturnIcon IMA={'/img/send-money.png'} Text={`Envoyer monais`} /></li>
    <li><ReturnIcon IMA={'/img/add-money.png'} Text={`Augmenter solde`} /></li>
    <li><ReturnIcon IMA={'/img/shop.png'} Text={`Shop`} /></li>

   </ul>

  </div>
 );
}
